insert into SprDocAdmProc (ID,PARENT_ID,IS_NODE,IS_SELECT,HI_CODE,HI_LEVEL,PROC_NO,NAME,FULL_NAME) values (700,34,2,2,'01.03.10.',3,'1.3.10.','подтверждающей право собственности умершего гражданина на жилой дом, жилое изолированное помещение с хозяйственными и иными постройками или без них, сведения о которых внесены в похозяйственную книгу сельского (поселкового) исполнительного и распорядительного органа до 8 мая 2003 г., но которые не зарегистрированы в территориальных организациях по государственной регистрации недвижимого имущества, прав на него и сделок с ним','Выдача справки подтверждающей право собственности умершего гражданина на жилой дом, жилое изолированное помещение с хозяйственными и иными постройками или без них, сведения о которых внесены в похозяйственную книгу сельского (поселкового) исполнительного и распорядительного органа до 8 мая 2003 г., но которые не зарегистрированы в территориальных организациях по государственной регистрации недвижимого имущества, прав на него и сделок с ним');
insert into SprDocAdmProc (ID,PARENT_ID,IS_NODE,IS_SELECT,HI_CODE,HI_LEVEL,PROC_NO,NAME,FULL_NAME) values (701,34,2,2,'01.03.11.',3,'1.3.11.','о том, что в установленный законодательством для принятия наследства срок наследник пользовался наследственным имуществом, принял меры к его сохранению, обрабатывал земельный участок, производил текущий ремонт и т.д.','Выдача справки о том, что в установленный законодательством для принятия наследства срок наследник пользовался наследственным имуществом, принял меры к его сохранению, обрабатывал земельный участок, производил текущий ремонт и т.д.');
